import React, { Component } from 'react'; // let's also import Component
import { CreateButton } from './createPromotions';
import { Grid } from '@material-ui/core';

export class Home extends Component {
  render() {

    return <Grid
      container
      spacing={0}
      direction="column"
      alignItems="center"
      justify="center" 
      className=""
      style={{ minHeight: '80vh' }}
    >
      <Grid item xs={12}>
        <h1>Welcome to moonactive!!</h1>
        <h4>press create to start</h4>
      </Grid>
      <Grid item xs={12}>
        <CreateButton />
      </Grid>

    </Grid>
  }
}
